import React from 'react';
import './header.css';

const Header = () => {

  return (
    <Header> 
      <div className="container header__container">
        <h5>Hello, I'm</h5>
        <h1>Rowan Kim</h1>
        <h5 className="text-light">Full Stack Developer</h5>
      </div>
    </Header>
  )
}

export default Header
